import React from 'react';

class VideoItem extends React.Component{

    constructor(props){
        super(props);

        this.state ={video:''};

        this.videoRef = React.createRef();
    }

     vItem = ({video}) =>{
        return(
            
            <div>
                {/* <img src={} /> */}
            {video.snippet.title}
            </div>
        );
    };

    render(){
        return(
            <div>{vItem}</div>

        );
    }

}

export default VideoItem;
